import React from "react";

class UploadSong extends React.Component {
  state = {};
  boxStyle = {
    position: "relative",
    width: "872px",
    height: "629px",
    background: "#050516"
  };
  render() {
    return <div style={this.boxStyle}>UploadSong</div>;
  }
}

export default UploadSong;
